import logo from './logo.svg';
import './App.css';
import smth from './MakingAnOrder';

function MakingAnOrder (){
  return(
      <div>
      <h4>Hello, I want to order a buquet!</h4>
      </div>
  );
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
      <MakingAnOrder/>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
